const Menu =  [
  { header: 'Inventario' },
  {
    title: 'categoria',
    group: 'inventario',
    icon: 'dashboard',
    name: 'Dashboard',
    to:{name:'mainCategory'}
  },
  {
    title: 'producto',
    group: 'inventario',
    icon: 'chat_bubble',
    // target: '_blank',
    name: 'Chat',
    to:{name:'mainProduct'}
  },

];
// reorder menu
Menu.forEach((item) => {
  if (item.items) {
    item.items.sort((x, y) => {
      let textA = x.title.toUpperCase();
      let textB = y.title.toUpperCase();
      return (textA < textB) ? -1 : (textA > textB) ? 1 : 0;
    });
  }
});

export default Menu;
